import React from "react";
import {Link } from "react-router-dom";


    function login() {

        return (
          <div>
            <Link to="/app.js"><button>
              confirm
            </button>
            </Link>
          </div>
        );

    }


function App() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            <img src= "upside ground logo.jpg" alt ="logo" className ="logo"  />
          </p> 
        </header>
        <table style="width:100%">
  <tr>
    <th>Firstname</th>
    <th>Lastname</th>
    <th>Age</th>
  </tr>
  <tr>
    <td>Jill</td>
    <td>Smith</td>
    <td>50</td>
  </tr>
  <tr>
    <td>Eve</td>
    <td>Jackson</td>
    <td>94</td>
  </tr>
</table>

      </div>
    );
  }

  export default login.js;
